import React, { Component, lazy, Suspense } from 'react';
import logo from './logo.svg';

//Lasy
const LazyPhotoComponet = lazy(() => import("./lazyComponet"));

class lazyContainer extends Component {
    constructor(){
        super();
        this.state = {
            photoDB: {}
        };
    };

    componentDidMount(){
        fetch('https://jsonplaceholder.typicode.com/photo/1')
        .then(response => response.json())
        .then(data => {
            this.setState({
            photoDB: data
            });
            console.log(data);
        })
    };

    render() {
      return (
        <div>
          <Suspense fallback={<div>Loading ....<img src={logo} className="App-logo" alt="logo" /></div>}><LazyPhotoComponet></LazyPhotoComponet></Suspense>
        </div>
      );
    }
  }
  
  export default lazyContainer;
